// Ogloszenie.js
import React from "react";

const Ogloszenia = ({ ogloszenie }) => {
  return (
    <div className="ogloszenia">
      <img src={ogloszenie.zdjecie} alt={ogloszenie.nazwa} />
      <h3>{ogloszenie.nazwa}</h3>
      <p>Email: {ogloszenie.email}</p>
      <p>Numer: {ogloszenie.numer}</p>
      <p>Miasto: {ogloszenie.miasto}</p>
      <p>Kategoria: {ogloszenie.kategoria}</p>
      <p>Opis: {ogloszenie.opis}</p>
    </div>
  );
};

export default Ogloszenie;
